func BlockID(blockNumber int) string {
	return StatePaletteIDs()[BlockStateIndices[blockNumber]]
}

func StatePaletteIDs() []string {
	return []string{
		"minecraft:bedrock",
		"minecraft:dirt",
		"minecraft:grass",
		"minecraft:air",
		"minecraft:crimson_planks",
		"minecraft:fence",
	}
}

// ByteSliceAsString is used to generate SubChunkValue from raw levelDB bytes
func ByteSliceAsString(data []byte) string {
	byteStrings := make([]string, len(data))

	for i, b := range data {
		byteStrings[i] = strconv.Itoa(int(b))
	}

	return fmt.Sprintf("[]byte{%s}", strings.Join(byteStrings, ", "))
}

// IntSliceAsString is used to generate BlockStateIndices from subchunk.blockStorage.Indices
func IntSliceAsString(data []int) string {
	s := make([]string, len(data))

	for i, b := range data {
		s[i] = strconv.Itoa(b)
	}

	return fmt.Sprintf("[]byte{%s}", strings.Join(s, ", "))
}
